import { IconButton, Toolbar } from '@material-ui/core';
import React from 'react';


const BarSesion = () => {
    return (
        <Toolbar>
            <IconButton color="inherit">
                <i className="material-icons">menu</i>
            </IconButton>
            
        </Toolbar>
    );
}

export default BarSesion;
